import React from 'react'
import logo from '../../assests/images/logo.png'

export default function Header() {
    return (
        <div><nav class="navbar navbar-light bg-white">
            <div class="container-fluid">
                <a class="navbar-brand" href="#"><img src={logo} alt="" width="38px" height="47.5px" class="d-inline-block align-text-top" /></a>
                <p>TheBox</p>
            </div>
        </nav>

        </div>
    )
}
